import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

export const navItems = [
  {
    title: 'Dashboard',
    submenu: [
      {
        title: 'SOG Dashboard',
        url: '/seaofgreen',
        menuRouteTitle:'/seaofgreen',
        parentTitle:'Dashboard',
      },
      {
        title: 'Incident Dashboard',
        url: '/',
        menuRouteTitle:'/',
        parentTitle:'Dashboard',
      }
    ],
  },
  {
      title: 'Configuration',
      submenuType:'horizontal',
      submenu: [
        {
          title: 'Hawkeye configuration',
          parentTitle:'Configuration',
          submenu: [
            {
              title: 'Data Source',
              url: '/configuration',
              menuRouteTitle:'DataSource',
              tabData:{tab:'DataSource'},
              parentTitle:'Configuration',
            },
            {
              title: 'Application',
              url: '/configuration',
              menuRouteTitle:'Application',
              tabData:{tab:'Application'},
              parentTitle:'Configuration',
            },
            {
              title: 'Metric',
              url: '/configuration',
              tabData:{tab:'Metric'},
              menuRouteTitle:'Metric',
              parentTitle:'Configuration',
            },
            {
              title: 'Query',
              url: '/configuration',
              tabData:{tab:'Query'},
              menuRouteTitle:'Query',
              parentTitle:'Configuration',
            },
            {
              title: 'Threshold',
              url: '/configuration',
              menuRouteTitle:'Threshold',
              tabData:{tab:'Threshold'},
              parentTitle:'Configuration',
            },
            {
              title: 'Notifications',
              url: '/configuration',
              menuRouteTitle:'Notifications',
              tabData:{tab:'Notifications'},
              parentTitle:'Configuration',
            },
            {
              title: 'DC Failover',
              url: '/configuration',
              menuRouteTitle:'DcOverride',
              tabData:{tab:'DcOverride'},
              parentTitle:'Configuration',
            },
          ]
        },
        {
          title: 'SOG configuration',
          parentTitle:'Configuration',
          submenu:[
            {
              title: 'Define Section',
              url: '/sogConfiguration/sections',
              menuRouteTitle:'/sogConfiguration/sections',
              parentTitle:'Configuration',
            },
            {
              title: 'Define Channel',
              url: '/sogConfiguration/channels',
              menuRouteTitle:'/sogConfiguration/channels',
              parentTitle:'Configuration',
            },
            {
              title: 'Define Panel',
              url: '/sogConfiguration/panels',
              menuRouteTitle:'/sogConfiguration/panels',
              parentTitle:'Configuration',
            },
            {
              title: 'Configure Rules and Policies',
              url: '/rulesAndPolicyConfig/rules',
              menuRouteTitle:'/rulesAndPolicyConfig/rules',
              parentTitle:'Configuration',
            }
          ]
        }
      ],
    },
];

const MenuItem = ({ title, url, submenu, onClick }) => {
  return (
    <li onClick={onClick}>
      <Link to={url}>{title}</Link>
      {submenu && submenu.active && <SubMenu submenu={submenu.items} />}
    </li>
  );
};

const SubMenu = ({ submenu }) => {
  return (
    <ul>
      {submenu.map((item, index) => (
        <MenuItem key={index} {...item} />
      ))}
    </ul>
  );
};

const NavItem = ({ title, submenu, onClick }) => {
  return (
    <li onClick={onClick}>
      <span>{title}</span>
      {submenu && submenu.active && <SubMenu submenu={submenu.items} />}
    </li>
  );
};

const Navigation = ({ navItems }) => {
  const [activeSubmenus, setActiveSubmenus] = useState({});

  const handleMenuClick = (title) => {
    setActiveSubmenus((prevActiveSubmenus) => ({
      ...prevActiveSubmenus,
      [title]: !prevActiveSubmenus[title],
    }));
  };

  const renderNavItem = (item) => (
    <NavItem
      key={item.title}
      title={item.title}
      onClick={() => handleMenuClick(item.title)}
      submenu={{
        active: activeSubmenus[item.title],
        items: item.submenu,
      }}
    />
  );

  return (
    <ul>
      {navItems.map((item) =>
        item.submenu ? (
          <React.Fragment key={item.title}>
            {renderNavItem(item)}
            {item.submenu.map((subItem) =>
              subItem.submenu ? (
                <React.Fragment key={subItem.title}>
                  {renderNavItem(subItem)}
                  <SubMenu submenu={subItem.submenu} />
                </React.Fragment>
              ) : (
                renderNavItem(subItem)
              )
            )}
          </React.Fragment>
        ) : (
          renderNavItem(item)
        )
      )}
    </ul>
  );
};

const App = () => {
  return (
    <Router>
      <Navigation navItems={navItems} />
    </Router>
  );
};

export default App;
